CREATE TABLE company(
    company_name_id  VARCHAR(38) NOT NULL PRIMARY KEY
    ,company_name     VARCHAR(39) NOT NULL
    ,url              VARCHAR(131) NOT NULL
    ,year_founded     INTEGER
    ,city             VARCHAR(20)
    ,state            VARCHAR(2) NOT NULL
    ,zip_code         INTEGER
    ,company_type     VARCHAR(30)
    ,company_category VARCHAR(25)
);
